gOK(){return"The text is written in an elegant uncial script in Greek, arranged in two columns per page, with 49-51 lines per column and approximately 20-25 letters per line. It follows scriptio continua (without spaces), with red ink used for the initial lines of each book and decorative tailpieces at the end of each book. Occasional punctuation marks and annotations (e.g., enlarged initials indicating new sections) are present."},
gOI(){return"Codex Alexandrinus takes its name from Alexandria, Egypt, where it was kept for some time. In the 17th century, Patriarch Cyril Lucaris brought it from Alexandria to Constantinople and later presented it to Charles I of England."},
gOE(){return"Textually, the codex exhibits a mixed character: the Gospels reflect the Byzantine text-type (Category III), while the rest of the New Testament belongs to the Alexandrian text-type (Category I)."},
gOG(){return"Today, Codex Alexandrinus is housed in the British Library in London, displayed alongside Codex Sinaiticus in the John Ritblat Gallery."},
