gNi(){return"\u041f\u0430\u043f\u0438\u0440\u0443\u0441 43 \u2013 \u044d\u0442\u043e \u043c\u0430\u043d\u0443\u0441\u043a\u0440\u0438\u043f\u0442 \u041d\u043e\u0432\u043e\u0433\u043e \u0417\u0430\u0432\u0435\u0442\u0430. \u041e\u043d \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 \u0441\u043e\u0431\u043e\u0439 \u0444\u0440\u0430\u0433\u043c\u0435\u043d\u0442 \u0441\u0432\u0435\u0442\u043b\u043e\u0433\u043e \u043f\u0430\u043f\u0438\u0440\u0443\u0441\u043d\u043e\u0433\u043e \u043b\u0438\u0441\u0442\u0430 \u0440\u0430\u0437\u043c\u0435\u0440\u043e\u043c \u043f\u0440\u0438\u043c\u0435\u0440\u043d\u043e 4 \xd7 7 \u0441\u043c, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0441 \u043e\u0431\u0435\u0438\u0445 \u0441\u0442\u043e\u0440\u043e\u043d \u043d\u0430\u043f\u0438\u0441\u0430\u043d \u0442\u0435\u043a\u0441\u0442 \u0438\u0437 \u043a\u043d\u0438\u0433\u0438 \u041e\u0442\u043a\u0440\u043e\u0432\u0435\u043d\u0438\u044f."},
