gNh(){return"\u042d\u0442\u043e\u0442 \u043f\u0435\u0440\u0432\u043e\u0438\u0441\u0442\u043e\u0447\u043d\u0438\u043a \u0431\u044b\u043b \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0440\u0430\u0441\u043a\u043e\u043f\u043e\u043a \u0432 \u0412\u0430\u0434\u0438 \u0421\u0430\u0440\u0433\u0430 \u0432 \u0415\u0433\u0438\u043f\u0442\u0435 \u0437\u0438\u043c\u043e\u0439 1913-1914 \u0433\u043e\u0434\u043e\u0432 \u043f\u043e\u0434 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e\u043c \u043c\u0438\u0441\u0442\u0435\u0440\u0430 \u0420. \u041a\u044d\u043c\u043f\u0431\u0435\u043b\u043b\u0430 \u0422\u043e\u043c\u043f\u0441\u043e\u043d\u0430."},
gNd(){return"\u0421 \u0442\u0435\u043a\u0441\u0442\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0442\u043e\u0447\u043a\u0438 \u0437\u0440\u0435\u043d\u0438\u044f, \u0440\u0443\u043a\u043e\u043f\u0438\u0441\u044c \u0441\u0447\u0438\u0442\u0430\u0435\u0442\u0441\u044f \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u0435\u043c \u0430\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0442\u0438\u043f\u0430 \u0442\u0435\u043a\u0441\u0442\u0430 \u0438 \u043a\u043b\u0430\u0441\u0441\u0438\u0444\u0438\u0446\u0438\u0440\u0443\u0435\u0442\u0441\u044f \u043a\u0430\u043a \u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u044f II \u0432 \u0441\u0438\u0441\u0442\u0435\u043c\u0435 \u043a\u043b\u0430\u0441\u0441\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u0438 \u0440\u0443\u043a\u043e\u043f\u0438\u0441\u0435\u0439 \u041d\u043e\u0432\u043e\u0433\u043e \u0417\u0430\u0432\u0435\u0442\u0430 \u041a\u0443\u0440\u0442\u0430 \u0410\u043b\u0430\u043d\u0434\u0430."},
gNf(){return"\u0412 \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u0435 \u0432\u0440\u0435\u043c\u044f \u041f\u0430\u043f\u0438\u0440\u0443\u0441 43 \u0445\u0440\u0430\u043d\u0438\u0442\u0441\u044f \u0432 \u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u0439 \u0431\u0438\u0431\u043b\u0438\u043e\u0442\u0435\u043a\u0435 \u0432 \u041b\u043e\u043d\u0434\u043e\u043d\u0435."},
gNs(){return"\u041f\u0430\u043f\u0438\u0440\u0443\u0441 47 (P<sup>47</sup>)"},
gNo(){return"\u041d\u0430\u0447\u0430\u043b\u043e III \u0432\u0435\u043a\u0430 \u043d.\u044d."},
