gMV(){return"\u041f\u0430\u043f\u0456\u0440\u0443\u0441 115 \u2013 \u0446\u0435 \u0444\u0440\u0430\u0433\u043c\u0435\u043d\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u0433\u0440\u0435\u0446\u044c\u043a\u0438\u0439 \u043c\u0430\u043d\u0443\u0441\u043a\u0440\u0438\u043f\u0442 \u041d\u043e\u0432\u043e\u0433\u043e \u0417\u0430\u043f\u043e\u0432\u0456\u0442\u0443, \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0438\u0439 \u043d\u0430 \u043f\u0430\u043f\u0456\u0440\u0443\u0441\u0456, \u0442\u0430\u043a\u043e\u0436 \u0432\u0456\u0434\u043e\u043c\u0438\u0439 \u044f\u043a \u041e\u043a\u0441\u0456\u0440\u0438\u043d\u0445\u0441\u044c\u043a\u0438\u0439 \u043f\u0430\u043f\u0456\u0440\u0443\u0441 #4499. \u0412\u0456\u043d \u0441\u043a\u043b\u0430\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0437 26 \u0444\u0440\u0430\u0433\u043c\u0435\u043d\u0442\u0456\u0432 \u043a\u043e\u0434\u0435\u043a\u0441\u0443, \u0449\u043e \u043c\u0456\u0441\u0442\u0438\u0442\u044c \u0447\u0430\u0441\u0442\u0438\u043d\u0438 \u043a\u043d\u0438\u0433\u0438 \u041e\u0431'\u044f\u0432\u043b\u0435\u043d\u043d\u044f. \u041e\u0440\u0438\u0433\u0456\u043d\u0430\u043b\u044c\u043d\u0456 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0438 \u043c\u0430\u043b\u0438 \u0440\u043e\u0437\u043c\u0456\u0440\u0438 \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u043d\u043e 15,5 \xd7 23,5 \u0441\u043c."},
