gOB(){return"\u0421\u0438\u043d\u0430\u0439\u0441\u044c\u043a\u0438\u0439 \u043a\u043e\u0434\u0435\u043a\u0441 \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0438\u0439 \u043d\u0430 \u043f\u0435\u0440\u0433\u0430\u043c\u0435\u043d\u0442\u0456 (vellum), \u0432\u0438\u0433\u043e\u0442\u043e\u0432\u043b\u0435\u043d\u043e\u043c\u0443 \u043f\u0435\u0440\u0435\u0432\u0430\u0436\u043d\u043e \u0437 \u0442\u0435\u043b\u044f\u0447\u043e\u0457 \u0448\u043a\u0456\u0440\u0438 (\u0456\u0437 \u043d\u0435\u0437\u043d\u0430\u0447\u043d\u0438\u043c \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f\u043c \u043e\u0432\u0435\u0447\u043e\u0457). \u0421\u043f\u043e\u0447\u0430\u0442\u043a\u0443 \u0432\u0456\u043d \u0441\u0442\u0432\u043e\u0440\u044e\u0432\u0430\u0432\u0441\u044f \u043d\u0430 \u043f\u043e\u0434\u0432\u0456\u0439\u043d\u0438\u0445 \u0430\u0440\u043a\u0443\u0448\u0430\u0445, \u0439\u043c\u043e\u0432\u0456\u0440\u043d\u043e, \u0440\u043e\u0437\u043c\u0456\u0440\u043e\u043c \u0431\u043b\u0438\u0437\u044c\u043a\u043e 40 \xd7 70 \u0441\u043c. \u0427\u0430\u0441\u0442\u0438\u043d\u0430 \u043a\u043e\u0434\u0435\u043a\u0441\u0443, \u0449\u043e \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u0454\u0442\u044c\u0441\u044f \u0432 \u0411\u0440\u0438\u0442\u0430\u043d\u0441\u044c\u043a\u0456\u0439 \u0431\u0456\u0431\u043b\u0456\u043e\u0442\u0435\u0446\u0456, \u0441\u043a\u043b\u0430\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0437 346\xbd \u0444\u043e\u043b\u0456\u043e (694 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0438) \u0440\u043e\u0437\u043c\u0456\u0440\u043e\u043c \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u043d\u043e 38,1 \xd7 34,5 \u0441\u043c."},
gOC(){return"\u0420\u0443\u043a\u043e\u043f\u0438\u0441 \u0432\u0438\u043a\u043e\u043d\u0430\u043d\u0438\u0439 \u0443 \u0444\u043e\u0440\u043c\u0430\u043b\u044c\u043d\u043e\u043c\u0443 \u0443\u043d\u0446\u0456\u0430\u043b\u044c\u043d\u043e\u043c\u0443 \u043f\u043e\u0447\u0435\u0440\u043a\u0443 (\u0431\u0456\u0431\u043b\u0456\u0439\u043d\u0438\u0439 \u043c\u0430\u044e\u0441\u043a\u0443\u043b) \u0433\u0440\u0435\u0446\u044c\u043a\u043e\u044e \u043c\u043e\u0432\u043e\u044e \u0456\u0437 \u0437\u0430\u0441\u0442\u043e\u0441\u0443\u0432\u0430\u043d\u043d\u044f\u043c scriptio continua (\u0431\u0435\u0437 \u043f\u0440\u043e\u0431\u0456\u043b\u0456\u0432 \u043c\u0456\u0436 \u0441\u043b\u043e\u0432\u0430\u043c\u0438). \u0422\u0435\u043a\u0441\u0442 \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0438\u0439 \u0443 \u0441\u0442\u043e\u0432\u043f\u0446\u044f\u0445: \u0447\u043e\u0442\u0438\u0440\u0438 \u0441\u0442\u043e\u0432\u043f\u0446\u0456 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0443 \u0432 \u041d\u043e\u0432\u043e\u043c\u0443 \u0417\u0430\u043f\u043e\u0432\u0456\u0442\u0456 \u0442\u0430 \u0434\u0432\u0430 \u2013 \u0443 \u043f\u043e\u0435\u0442\u0438\u0447\u043d\u0438\u0445 \u0442\u0435\u043a\u0441\u0442\u0430\u0445 \u0412\u0435\u0442\u0445\u043e\u0433\u043e \u0417\u0430\u043f\u043e\u0432\u0456\u0442\u0443. \u0423 \u043a\u043e\u0434\u0435\u043a\u0441\u0456 \u0440\u0435\u0442\u0435\u043b\u044c\u043d\u043e \u043f\u0440\u043e\u0434\u0443\u043c\u0430\u043d\u0456 \u0440\u043e\u0437\u0440\u0438\u0432\u0438 \u0440\u044f\u0434\u043a\u0456\u0432, \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0442\u044c\u0441\u044f nomina sacra \u0442\u0430 \u0441\u043f\u0435\u0446\u0438\u0444\u0456\u0447\u043d\u0430 \u043f\u0443\u043d\u043a\u0442\u0443\u0430\u0446\u0456\u044f."},
gOA(){return"\u041a\u043e\u0434\u0435\u043a\u0441 \u0431\u0443\u043b\u043e \u0432\u0438\u044f\u0432\u043b\u0435\u043d\u043e 1844 \u0440\u043e\u043a\u0443 \u0432 \u043c\u043e\u043d\u0430\u0441\u0442\u0438\u0440\u0456 \u0421\u0432\u044f\u0442\u043e\u0457 \u041a\u0430\u0442\u0435\u0440\u0438\u043d\u0438 \u043d\u0430 \u0421\u0438\u043d\u0430\u0439\u0441\u044c\u043a\u043e\u043c\u0443 \u043f\u0456\u0432\u043e\u0441\u0442\u0440\u043e\u0432\u0456 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043c \u0444\u043e\u043d \u0422\u0456\u0448\u0435\u043d\u0434\u043e\u0440\u0444\u043e\u043c."},
