gPp(){return"\u0417 \u0442\u0435\u043a\u0441\u0442\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u043e\u0457 \u0442\u043e\u0447\u043a\u0438 \u0437\u043e\u0440\u0443, \u043a\u043e\u0434\u0435\u043a\u0441 \u0454 \u0437\u043c\u0456\u0448\u0430\u043d\u0438\u043c \u043c\u0430\u043d\u0443\u0441\u043a\u0440\u0438\u043f\u0442\u043e\u043c: \u0442\u0435\u043a\u0441\u0442 \u043f\u043e\u0441\u043b\u0430\u043d\u044c \u0430\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u041f\u0430\u0432\u043b\u0430 \u0442\u0430 \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u0438\u0445 \u043f\u043e\u0441\u043b\u0430\u043d\u044c \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u0454 \u0440\u0438\u0441\u0438 \u0430\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u0442\u0438\u043f\u0443 \u0442\u0430 \u0432\u0456\u0434\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u0434\u043e \u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0456\u0457 III, \u0442\u043e\u0434\u0456 \u044f\u043a \u0442\u0435\u043a\u0441\u0442 \u0414\u0456\u044f\u043d\u044c \u0442\u0430 \u041e\u0431'\u044f\u0432\u043b\u0435\u043d\u043d\u044f \u043d\u0430\u043b\u0435\u0436\u0438\u0442\u044c \u0434\u043e \u0432\u0456\u0437\u0430\u043d\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u0442\u0438\u043f\u0443 \u0456 \u043a\u043b\u0430\u0441\u0438\u0444\u0456\u043a\u0443\u0454\u0442\u044c\u0441\u044f \u044f\u043a \u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0456\u044f V."},
