gPQ(){return"X \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f \u043d.\u0435."},
gPO(){return"\u0424\u0440\u0430\u0433\u043c\u0435\u043d\u0442\u0438 \u041e\u0431'\u044f\u0432\u043b\u0435\u043d\u043d\u044f (11:15-19); (12:1-18); (13:1,3-18); (14:1-20); (15:1-8); (16:1-21); (17:1-18); (18:1-24); (19:1-21); (20:1-15); (21:1-27); (22:1-7,15-21)."},
gPS(){return"\u0423\u043d\u0446\u0456\u0430\u043b \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0438\u0439 \u043d\u0430 \u043f\u0435\u0440\u0433\u0430\u043c\u0435\u043d\u0442\u0456 (vellum). \u0412\u0456\u043d \u0441\u043a\u043b\u0430\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0437 92 \u0444\u043e\u043b\u0456\u043e, \u043a\u043e\u0436\u043d\u0435 \u0437 \u044f\u043a\u0438\u0445 \u043c\u0430\u0454 \u0440\u043e\u0437\u043c\u0456\u0440 \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u043d\u043e 23 \xd7 18 \u0441\u043c. \u0420\u0443\u043a\u043e\u043f\u0438\u0441 \u043c\u0456\u0441\u0442\u0438\u0442\u044c \u043d\u0435\u043f\u043e\u0432\u043d\u0438\u0439 \u0442\u0435\u043a\u0441\u0442 \u041e\u0431'\u044f\u0432\u043b\u0435\u043d\u043d\u044f \u0440\u0430\u0437\u043e\u043c \u0437 \u043a\u043e\u043c\u0435\u043d\u0442\u0430\u0440\u0435\u043c \u0410\u043d\u0434\u0440\u0456\u044f \u041a\u0435\u0441\u0430\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e."},
gPT(){return"\u0422\u0435\u043a\u0441\u0442 \u0432\u0438\u043a\u043e\u043d\u0430\u043d\u0438\u0439 \u0443\u043d\u0446\u0456\u0430\u043b\u044c\u043d\u0438\u043c\u0438 \u043b\u0456\u0442\u0435\u0440\u0430\u043c\u0438, \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0438\u043c\u0438 \u0432 \u043e\u0434\u043d\u0443 \u043a\u043e\u043b\u043e\u043d\u043a\u0443 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 \u0437 22 \u0440\u044f\u0434\u043a\u0430\u043c\u0438 (\u0442\u0435\u043a\u0441\u0442\u043e\u0432\u0438\u0439 \u0431\u043b\u043e\u043a \u043c\u0430\u0454 \u0440\u043e\u0437\u043c\u0456\u0440\u0438 16,6 \xd7 10,5 \u0441\u043c). \u0423\u043d\u0446\u0456\u0430\u043b\u044c\u043d\u0456 \u043b\u0456\u0442\u0435\u0440\u0438 \u0442\u0440\u043e\u0445\u0438 \u043d\u0430\u0445\u0438\u043b\u0435\u043d\u0456 \u0432\u043f\u0440\u0430\u0432\u043e, \u0430 \u043a\u043e\u043c\u0435\u043d\u0442\u0430\u0440 \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0438\u0439 \u043a\u0443\u0440\u0441\u0438\u0432\u043e\u043c. \u0420\u0443\u043a\u043e\u043f\u0438\u0441 \u043c\u0456\u0441\u0442\u0438\u0442\u044c \u043f\u0440\u0438\u0434\u0438\u0445\u0438 \u0442\u0430 \u043d\u0430\u0433\u043e\u043b\u043e\u0441\u0438."},
gPR(){return"\u0420\u0443\u043a\u043e\u043f\u0438\u0441 \u043f\u0440\u0438\u0432\u0435\u0440\u043d\u0443\u0432 \u0443\u0432\u0430\u0433\u0443 \u0432\u0447\u0435\u043d\u0438\u0445 \u0443 1899 \u0440\u043e\u0446\u0456, \u043a\u043e\u043b\u0438 \u0431\u0443\u0432 \u0441\u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u043e\u0432\u0430\u043d\u0438\u0439 \u041a\u0456\u0440\u0441\u043e\u043f\u043e\u043c \u041b\u0435\u0439\u043a\u043e\u043c \u0443 \u043c\u043e\u043d\u0430\u0441\u0442\u0438\u0440\u0456 \u041f\u0430\u043d\u0442\u043e\u043a\u0440\u0430\u0442\u043e\u0440 \u043d\u0430 \u0410\u0444\u043e\u043d\u0441\u044c\u043a\u0456\u0439 \u0433\u043e\u0440\u0456."},
gPN(){return"\u0417 \u0442\u0435\u043a\u0441\u0442\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u043e\u0457 \u0442\u043e\u0447\u043a\u0438 \u0437\u043e\u0440\u0443, \u0443\u043d\u0446\u0456\u0430\u043b \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u0454 \u0437\u043c\u0456\u0448\u0430\u043d\u0438\u0439 \u0442\u0438\u043f \u0442\u0435\u043a\u0441\u0442\u0443 \u0442\u0430 \u043a\u043b\u0430\u0441\u0438\u0444\u0456\u043a\u0443\u0454\u0442\u044c\u0441\u044f \u044f\u043a \u0440\u0443\u043a\u043e\u043f\u0438\u0441 \u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0456\u0457\xa0III \u0441\u0435\u0440\u0435\u0434 \u043c\u0430\u043d\u0443\u0441\u043a\u0440\u0438\u043f\u0442\u0456\u0432 \u041d\u043e\u0432\u043e\u0433\u043e \u0417\u0430\u043f\u043e\u0432\u0456\u0442\u0443."},
gPP(){return"\u0421\u044c\u043e\u0433\u043e\u0434\u043d\u0456 \u0423\u043d\u0446\u0456\u0430\u043b 051 \u043f\u0440\u043e\u0434\u043e\u0432\u0436\u0443\u0454 \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u0442\u0438\u0441\u044f \u0432 \u043c\u043e\u043d\u0430\u0441\u0442\u0438\u0440\u0456 \u041f\u0430\u043d\u0442\u043e\u043a\u0440\u0430\u0442\u043e\u0440 \u043d\u0430 \u0433\u043e\u0440\u0456 \u0410\u0444\u043e\u043d, \u0413\u0440\u0435\u0446\u0456\u044f."},
